using Exemplo.Interfaces;namespace Exemplo.Models{    public class Calculadora : ICalculadora    {        public int Somar(int numero1, int numero2)        {            return numero1 + numero2;        }        public int Subtrair(int numero1, int numero2)        {            return numero1 - numero2;        }        public int Multiplicar(int numero1, int numero2)        {            return numero1 * numero2;        }            }}